import Header from "modules/Header/Header";
import { Row, Col, Image } from "react-bootstrap";
import products from "products";
import { RouteComponentProps } from "react-router";
import { RouteParams } from "pages/CardProduct/types";
import { CardProductProps } from "pages/CardProduct/types";

const CardProduct = ({ match }: RouteComponentProps<RouteParams>): any => {
	const product = products.filter(
		(prod) => prod._vendorСode === match.params.vendorCode
	);

	product.push({
		_vendorСode: "43041452",
		name: "Calvin Klein Night",
		image: "/images/orig.jpg",
		description:
			"Architectural. Retro. Calvin Klein established. An iconic look with infallible chic. The well-designed round and curved glass pebble case, along with the meticulous details on the dial make of this timepiece the perfect fusion of radical modernity and timeless sophistication.",
		brand: "Calvin Klein",
		sex: "Women",
		price: 209.0,
		countInStock: 1,
		case: "Stainless stee",
		strap: "Leather",
		material: "Mineral crystal",
		movement: "Swiss quartz",
		dial: "Black",
		caseSize: 32.0,
		waterResistant: 30,
		color: "BLACK/SILVER",
		new: true,
	});

	return (
		<>
			<Header />

			{console.log(product)}
			<Row>
				<Col>{product.name}</Col>
			</Row>
		</>
	);
};

export default CardProduct;
